import { http, HttpResponse } from 'msw'

export const handlers = [
    http.post("/getPhoneCompatibility", ({req}) => {
        console.log(req)
        return HttpResponse.json({
            data: {
              pets: [
                { id: 1, name: 'Tom' },
                { id: 2, name: 'Jerry' },
                { id: 3, name: 'Spike' },
              ],
            },
          })
    })
];
